export default class extends React.Component {
  render() {
      return <div>
          <header></header>

          <style jsx global> {`
            header {
                color: #fff;
                background: #8756ca;
                padding: 15px;
            }
          `} </style>
          <style jsx global>{`
            body {
                margin: 0;
                font-family: system-ui;
                background: white;
            }
          `}</style>
      </div>
  }
}
